    "### **Introduction**\n",
    "\n",
    "Smoking is a pervasive public health concern that detrimentally affects nearly every organ system, leading to a multitude of diseases and a reduction in life expectancy for smokers. The World Health Organization (WHO) has projected that, by the year 2030, smoking will be responsible for 10 million deaths annually, underscoring its continued significance as a global health challenge (WHO, 2...). Despite the availability of evidence-based cessation interventions, less than one-third of individuals who attempt to quit smoking achieve success4. This low success rate is attributed to the addictive nature of nicotine and the complex behavioral, psychological, and social factors associated with smoking.\n",
    "\n",
    "\n",
    "### **Background**\n",
    "\n",
    "Physicians often encounter barriers when attempting to counsel all smokers due to the time-intensive nature of such interventions and the perceived ineffectiveness of counseling on smoking cessation outcomes. The Centers for Disease Control and Prevention (CDC) report that smoking is the leading cause of preventable death in the United States, with more than 480,000 deaths each year attributed to cigarette smoking. This staggering statistic highlights the urgent need for effective smoking cessation strategies. One approach is to identify those who are smokers and what peculiar health indicators could help with such deduction. \n",
    "\n",
    "The health risks associated with smoking are extensive and include increased susceptibility to cardiovascular disease, stroke, respiratory diseases, and various forms of cancer. The economic burden of smoking-related healthcare costs and lost productivity further exacerbates the impact of tobacco use on society. Given the profound health and economic consequences of smoking, it is imperative to enhance the effectiveness of smoking cessation interventions and to support healthcare professionals in their efforts to assist patients in quitting smoking.\n",
    "\n",
    "### **Project Purpose/Objective**\n",
    "\n",
    "Developing a machine learning model that incorporates key factors that informs on one's smoking attributes could significantly advance the understanding and ability to provide personalized support towards smoking cessation. The current project aims to contribute to this goal by constructing a machine learning model to identify smoking status. Leveraging a dataset with over 20 smoking indicators, we train an algorithm to classify individuals into binary categories of smoker or non-smoker status. \n",
    "\n",
    "This project is also from a contuining Kaggle competition. [See Here](https://www.kaggle.com/datasets/gauravduttakiit/smoker-status-prediction-using-biosignals) and [Here](https://www.kaggle.com/competitions/playground-series-s3e24/data)\n"
   ]
  },
