    "### **Performance Metrics**\n",
    "\n",
    "The Preferred metric for the competition is the Area Under Curve.\n",
    "\n",
    "**AUC (Area Under the Curve)** : AUC represents the area under the receiver operating characteristic (ROC) curve and provides a comprehensive measure of a model's ability to distinguish between different classes, particularly in binary classification problems.\n",
    "\n",
    "The following evaluation metrics were also employed to evaluate model performance. \n",
    "\n",
    "**Log Loss**: Log Loss measures the accuracy of a classification model by quantifying the likelihood of predicted class probabilities against the actual class labels.\n",
    "\n",
    "\n",
    "**Accuracy** : Accuracy calculates the ratio of correctly predicted instances to the total instances, offering an overall measure of the model's correctness.\n",
    "\n",
    "**Sensitivity (True Positive Rate, Recall)** : Sensitivity gauges the ability of the model to correctly identify positive instances, revealing the proportion of true positives among all actual positive instances.\n",
    "\n",
    "**Specificity (True Negative Rate)** : Specificity assesses the model's capability to correctly identify negative instances, indicating the proportion of true negatives among all actual negative instances.\n",
    "\n",
    "\n",
    "**Precision (Positive Predictive Value)** : Precision measures the accuracy of positive predictions by calculating the ratio of true positives to the total predicted positives, offering insights into the reliability of positive predictions made by the model."
   ]
