    "## **Data Preprocessing**\n",
    "\n",
    "The names of the features were cleaned using the `janitor` package. Then, I tried converting the factor features into factors using the recipe package functions but it kept breaking when I run the models. So I did this manually. \n",
    "\n",
    "The recipe package was further used to preprocess the predictors before model training. The first step flagged any missing values to clearly indicate their presence. For categorical variables, missing values were then imputed using the mode to fill in the most common category.\n",
    "\n",
    "The categorical predictors were one-hot encoded to create binary dummy variables representing each unique level. Numeric predictors were processed to handle zero-variance features, constants, and scaling. First, near zero-variance predictors were removed as they provide little informational value. Next, the remaining numeric features were normalized to have a mean of 0 and standard deviation of 1 to compare predictors on a common scale. Finally, features with no variation after normalization were removed."
   ]
