   "source": [
    "In the current project, I sought to build a predictive model which predicts smoking status from bio-signal features. Models that were fit included `Logistic Regression with Ridge Penalty`, `Linear Regression with Lasso Penalty`, and `Gradient Boosting Machine`.\n",
    "\n",
    "The Gradient Boosting Machine model performed the best with an area under the curve (AUC) of 0.867 and an Accuracy of 0.782, indicating it likely offers the optimal balance between true positive rate and false positive rate for classification tasks. It also had the most optimal log loss likelihood of 0.441. The Linear Regression with Lasso Penalty achieved the second highest AUC at 0.835, slightly outperforming Logistic Regression with Ridge Penalty, which had an AUC of 0.832. It is my belief that the Gradient Boosting Machine might perform even better if all hyperparameters were tuned. For instance, the only tuning performed was for the number of trees. Perhaps, in future works, it will be important to tune other features like the learning rate, maximum depth of trees, minimum node, and bag fraction. Additional tuning actually presents an opportunity to extract even greater predictive power from the Gradient Boosting Machine model.\n",
    "\n",
    "Overall, the **Gradient Boosting Machine appears to be the superior model and thus, is the model of choice.** While the Logistic Regression models with regularization were the least preferred based on AUC alone, they may still prove useful if other metrics like Precision are a top priority."
   ]
