    "## **Variable Importance**\n",
    "\n",
    " The top three highest-scoring variables are `hemoglobin_gm_dl`, `triglycerides_mg_dl`, and `cholesterol_mg_dl`, indicating that these factors had the most significant positive impact on the overall score. \n",
    " \n",
    " Conversely, the three lowest-scoring variables are `urine_protein_one`, `dental_caries_positive`, and `urine_glucose_negative`. These variables scored the least, suggesting they are areas that may require attention or improvement. The chart serves as a useful tool for quickly identifying which variables are performing well and which are not, providing a clear visual representation of the data."
